import React, { useEffect } from 'react'
import './Components.css';

import Facebook from '../Login/Facebook';

import {
    Row,
    Col,
    Nav,
    Image,
} from 'react-bootstrap';

const LOGO = require('../../assets/images/login/logo.png');


function Navbar(props) {

    useEffect(async () => {
        const authToken = await localStorage.getItem('authtoken');
        const userData = await localStorage.getItem('userData');
        
        console.log("navbar userData", JSON.parse(userData));
        console.log("navbar auth token",authToken);
    },[]);

    return (
        <Nav
            activeKey="/home"
            onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
            // className="justify-content-between mx-0 pt-0"
            style={{
                backgroundColor: 'white',
                boxShadow: "0px 3px 6px rgba(0, 0, 0, 0.16)",
            }}
        >
                        
            {/* <Col lg={1} /> */}

                <Col lg={6}>
                    <Row>
                        <Col className="d-flex" lg={4}>
                            <Image src={LOGO} className={"m-auto p-3"} />
                        </Col>


                        <Col lg={8}  className="d-flex">
                            <Row className={"mt-auto p-3"}>
                                {
                                    props.menuItems.length > 0 
                                    && 
                                    props.menuItems.map(((menuItem,index) => 
                                        <Nav.Item key={index}>
                                            <Nav.Link href={menuItem.route} className="navbar-menu-title">{menuItem.title}</Nav.Link>
                                        </Nav.Item>
                                    ))
                                }
                            </Row>
                        </Col>
                    </Row>
                </Col>

                <Col lg={5} className="d-flex">
                    <Row className={"my-auto ml-auto p-3"}>

                        {
                            props.userData !== undefined 
                            ?
                            <Nav.Item>
                                <p>USERDATA !!!</p>
                            </Nav.Item>
                            :
                            <>
                            <Nav.Item>
                                <Facebook content="Login" />
                            </Nav.Item>
                            {/* <Nav.Item>
                                <Form>
                                    <Form.Group controlId="exampleForm.ControlSelect1">
                                        <Form.Control as="select">
                                            <option>1</option>
                                            <option>2</option>
                                            <option>3</option>
                                            <option>4</option>
                                            <option>5</option>
                                        </Form.Control>
                                    </Form.Group>
                                </Form>
                            </Nav.Item> 
                            */}
                            </>
                        }
                    </Row>
                </Col>
            
            <Col lg={1} />

        </Nav>
    )
}


export default Navbar;
